import React from "react";
import { motion } from "framer-motion";
import '../components/Header.jsx';

const AboutUs = () => {
  return (
    <div className="about-us-page" style={styles.container}>
      {/* About Section */}
      <section style={styles.aboutSection}>
        <div style={styles.aboutContent}>
          {/* Image */}
          <motion.div
            style={styles.imageContainer}
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{
              duration: 1.5,
              ease: "easeInOut",
            }}
          >
            <img
              src="/images/1.jpg" // Replace with a high-quality, construction-related image
              alt="Ceylone Engineering Team"
              style={styles.image}
            />
          </motion.div>
          {/* Text Content */}
          <motion.div
            style={styles.textContent}
            initial={{ x: -100, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{
              duration: 1.5,
              ease: "easeInOut",
              delay: 0.2,
            }}
          >
            <h2 style={styles.heading}>Who We Are</h2>
            <p style={styles.paragraph}>
              At Ceylone Engineering, we’ve been crafting top-notch ironworks for
              over 15 years. From custom gates to intricate railings, we combine
              tradition, technology, and passion to deliver excellence. Our mission
              is to enhance every space with durable, elegant, and bespoke iron
              creations.
            </p>
            <p style={styles.paragraph}>
              Our team of highly skilled engineers and craftsmen are dedicated to
              ensuring quality in every detail. From concept to installation, we
              work closely with our clients to bring their visions to life. We are
              proud to be at the forefront of innovation in the ironworks industry.
            </p>
            <button style={styles.ctaButton}>Learn More</button>
          </motion.div>
        </div>
      </section>

      {/* Highlights Section */}
      <section style={styles.highlightsSection}>
        <h3 style={styles.highlightsHeading}>Why Choose Us?</h3>
        <div style={styles.highlights}>
          <motion.div
            style={styles.highlight}
            initial={{ y: 100, opacity: 0 }}
            animate={{ y: 0, opacity: 1 }}
            transition={{ duration: 1, ease: "easeOut", delay: 0.1 }}
          >
            <h4>Experience</h4>
            <p>Over 15 years of expertise in custom ironwork solutions.</p>
          </motion.div>
          <motion.div
            style={styles.highlight}
            initial={{ y: 100, opacity: 0 }}
            animate={{ y: 0, opacity: 1 }}
            transition={{ duration: 1, ease: "easeOut", delay: 0.2 }}
          >
            <h4>Quality</h4>
            <p>We use premium materials and precise craftsmanship.</p>
          </motion.div>
          <motion.div
            style={styles.highlight}
            initial={{ y: 100, opacity: 0 }}
            animate={{ y: 0, opacity: 1 }}
            transition={{ duration: 1, ease: "easeOut", delay: 0.3 }}
          >
            <h4>Innovation</h4>
            <p>Modern designs tailored to meet your unique needs.</p>
          </motion.div>
        </div>
      </section>

      {/* Call to Action Section */}
      <section style={styles.callToAction}>
        <motion.h3
          style={styles.ctaHeading}
          initial={{ scale: 0.9, opacity: 0 }}
          animate={{ scale: 1, opacity: 1 }}
          transition={{ duration: 0.8, ease: "easeInOut" }}
        >
          Ready to Elevate Your Space?
        </motion.h3>
        <p style={styles.ctaParagraph}>
          Contact Ceylone Engineering today and let's bring your vision to life.
        </p>
        <motion.button
          style={styles.ctaButtonLarge}
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.9 }}
        >
          Get in Touch
        </motion.button>
      </section>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "'Roboto', sans-serif",
    color: "#333",
    lineHeight: "1.6",
    backgroundColor: "#f7f7f7",
  },
  aboutSection: {
    padding: "40px 20px",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#e2e2e2",
    borderRadius: "10px",
    boxShadow: "0 8px 16px rgba(0, 0, 0, 0.1)",
  },
  aboutContent: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    maxWidth: "1200px",
    width: "100%",
    gap: "20px",
    flexWrap: "wrap",
  },
  imageContainer: {
    flex: 1,
    display: "flex",
    justifyContent: "center",
  },
  textContent: {
    flex: 1,
    textAlign: "left",
  },
  image: {
    width: "60%",
    maxWidth: "500px",
    borderRadius: "10px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
  },
  heading: {
    fontSize: "2.5rem",
    fontWeight: "bold",
    marginBottom: "1rem",
    color: "#f0a500",
  },
  paragraph: {
    fontSize: "1.1rem",
    marginBottom: "1.5rem",
    color: "#444",
  },
  ctaButton: {
    padding: "12px 20px",
    backgroundColor: "#f0a500",
    color: "#fff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    transition: "background-color 0.3s",
  },
  ctaButtonLarge: {
    padding: "15px 30px",
    backgroundColor: "#f0a500",
    color: "#fff",
    fontSize: "1.2rem",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    transition: "background-color 0.3s",
  },
  highlightsSection: {
    padding: "40px 20px",
    backgroundColor: "#fff",
    textAlign: "center",
  },
  highlightsHeading: {
    fontSize: "2rem",
    marginBottom: "20px",
    color: "#333",
  },
  highlights: {
    display: "flex",
    justifyContent: "center",
    flexWrap: "wrap",
    gap: "20px",
  },
  highlight: {
    flex: "1 1 calc(33.333% - 20px)",
    minWidth: "200px",
    padding: "20px",
    backgroundColor: "#f7f7f7",
    borderRadius: "8px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
  },
  callToAction: {
    padding: "40px 20px",
    backgroundColor: "#f0a500",
    color: "#fff",
    textAlign: "center",
  },
  ctaHeading: {
    fontSize: "2.5rem",
    marginBottom: "20px",
  },
  ctaParagraph: {
    fontSize: "1.2rem",
    marginBottom: "20px",
  },
};

export default AboutUs;
